import s from './MyPosts.module.css'

const MyPosts = (props) => {
    return (
        <div className={s.items}>
            <div>My posts</div>
            <textarea>New post</textarea>
            <button>add post</button>
            {props.postElement}
        </div>
    );
};

export default MyPosts;
